// Pattern and Color Management for Clinical Genogram

// Define and export the PatternManager class
window.PatternManager = class PatternManager {
    constructor() {
        // Define all available patterns (using base64 encoded PNG images)
this.availablePatterns = [
    { id: 'pattern-01', name: 'Top-Left Fill', type: 'quadrant', base64: '' },
    { id: 'pattern-02', name: 'Top-Right Fill', type: 'quadrant', base64: '' },
    { id: 'pattern-03', name: 'Bottom-Left Fill', type: 'quadrant', base64: '' },
    { id: 'pattern-04', name: 'Bottom-Right Fill', type: 'quadrant', base64: '' },
    { id: 'pattern-05', name: 'Dots', type: 'pattern', base64: '' },
    { id: 'pattern-06', name: 'Horizontal Lines', type: 'pattern', base64: '' },
    { id: 'pattern-07', name: 'Vertical Lines', type: 'pattern', base64: '' },
    { id: 'pattern-08', name: 'Diagonal Right', type: 'pattern', base64: '' },
    { id: 'pattern-09', name: 'Diagonal Left', type: 'pattern', base64: '' },
    { id: 'pattern-10', name: 'Checkerboard', type: 'pattern', base64: '' },
    { id: 'pattern-11', name: 'Cross-Hatch', type: 'pattern', base64: '' },
    { id: 'pattern-12', name: 'Small Dots', type: 'pattern', base64: '' },
    { id: 'pattern-13', name: 'Grid', type: 'pattern', base64: '' },
    { id: 'pattern-14', name: 'Waves', type: 'pattern', base64: '' },
    { id: 'pattern-15', name: 'Brick', type: 'pattern', base64: '' },
    { id: 'pattern-16', name: 'Zigzag', type: 'pattern', base64: '' }
];
        this.conditionPatternMap = {}; // Maps condition name to pattern id
        this.usedPatterns = new Set();
        this.colorScale = null;
        this.conditionColorMap = {}; // Maps condition name to custom color
        
        // Define a palette of bright, distinguishable colors
        this.availableColors = [
            '#FF6B6B', // Red
            '#4ECDC4', // Teal
            '#FFE66D', // Yellow
            '#95E1D3', // Mint
            '#FF8B94', // Pink
            '#A8E6CF', // Light Green
            '#FFD93D', // Gold
            '#6BCF7F', // Green
            '#95B8D1', // Blue
            '#E8A0BF', // Rose
            '#FFA07A', // Light Salmon
            '#98D8C8', // Seafoam
            '#F7B731', // Orange
            '#A29BFE', // Lavender
            '#FD79A8', // Hot Pink
            '#74B9FF', // Sky Blue
            '#55E6C1', // Turquoise
            '#FEA47F', // Peach
            '#B8E994', // Lime
            '#F8B500'  // Amber
        ];
    }

    // Initialize color scale
    initColorScale(conditions) {
        this.colorScale = d3.scaleOrdinal(d3.schemeCategory10).domain(conditions);
    }
    

    // Get or assign a pattern for a condition
    getPatternForCondition(condition) {
        if (!this.conditionPatternMap[condition]) {
            this.conditionPatternMap[condition] = this.assignRandomPattern();
            console.log(`[PatternManager] Assigned pattern "${this.conditionPatternMap[condition]}" to condition "${condition}"`);
        }
        return this.conditionPatternMap[condition];
    }
    // Assign pattern in numerical order
    assignRandomPattern() {
        // Find the first unused pattern in order
        for (const pattern of this.availablePatterns) {
            if (!this.usedPatterns.has(pattern.id)) {
                this.usedPatterns.add(pattern.id);
                return pattern.id;
            }
        }
        // If all patterns used, reset and start over with pattern-01
        this.usedPatterns.clear();
        const firstPattern = this.availablePatterns[0].id;
        this.usedPatterns.add(firstPattern);
        return firstPattern;
    }

    // Change pattern for a specific condition
    changePattern(condition) {
        const currentPattern = this.conditionPatternMap[condition];
        if (currentPattern) {
            this.usedPatterns.delete(currentPattern);
        }
        this.conditionPatternMap[condition] = this.assignRandomPattern();
        return this.conditionPatternMap[condition];
    }

    // Get condition currently using a specific pattern
    getConditionByPattern(patternId) {
        for (const [condition, pattern] of Object.entries(this.conditionPatternMap)) {
            if (pattern === patternId) {
                return condition;
            }
        }
        return null;
    }

    // Set a specific pattern for a condition
    setPatternForCondition(condition, newPatternId) {
        const currentPattern = this.conditionPatternMap[condition];
        const conditionUsingNewPattern = this.getConditionByPattern(newPatternId);

        if (conditionUsingNewPattern && conditionUsingNewPattern !== condition) {
            // Pattern is already in use - swap patterns
            console.log(`[PatternManager] Swapping patterns: "${condition}"  "${conditionUsingNewPattern}"`);
            this.conditionPatternMap[conditionUsingNewPattern] = currentPattern;
            this.conditionPatternMap[condition] = newPatternId;
        } else {
            // Pattern is not in use - simply assign it
            console.log(`[PatternManager] Assigning unused pattern "${newPatternId}" to "${condition}"`);
            if (currentPattern) {
                this.usedPatterns.delete(currentPattern);
            }
            this.conditionPatternMap[condition] = newPatternId;
            this.usedPatterns.add(newPatternId);
        }
        
        return newPatternId;
    }
    // Create SVG pattern definition using PNG image data URI with transparency
    // Create SVG pattern definition using PNG image data URI with transparency
    // Returns a promise that resolves when pattern is created
    createSVGPattern(defs, patternId) {
        return new Promise((resolve) => {
            const patternInfo = this.availablePatterns.find(p => p.id === patternId);
            if (!patternInfo) {
                console.error(`[PatternManager] Pattern not found: ${patternId}`);
                resolve();
                return;
            }

            console.log(`[PatternManager] Creating transparent SVG pattern "${patternId}"`);

            // Create canvas to convert white to transparent
            const canvas = document.createElement('canvas');
            const ctx = canvas.getContext('2d');
            const img = new Image();
            
            // Load base64 image
            img.onload = () => {
                canvas.width = img.width;
                canvas.height = img.height;
                ctx.drawImage(img, 0, 0);
                
                // Get image data and make white transparent
                const imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
                const data = imageData.data;
                
                for (let i = 0; i < data.length; i += 4) {
                    // If pixel is white or very light, make it transparent
                    if (data[i] > 250 && data[i+1] > 250 && data[i+2] > 250) {
                        data[i+3] = 0; // Set alpha to 0 (transparent)
                    }
                }
                
                ctx.putImageData(imageData, 0, 0);
                
                // Create pattern with transparent image (NO white background here)
                // White background will be added separately where needed
                const pattern = defs.append("pattern")
                    .attr("id", patternId)
                    .attr("patternUnits", "objectBoundingBox")
                    .attr("patternContentUnits", "objectBoundingBox")
                    .attr("width", "1")
                    .attr("height", "1")
                    .attr("x", "0")
                    .attr("y", "0");

                // Only add the pattern image (with transparent white pixels)
                pattern.append("image")
                    .attr("href", canvas.toDataURL('image/png'))
                    .attr("x", "0")
                    .attr("y", "0")
                    .attr("width", "1")
                    .attr("height", "1")
                    .attr("preserveAspectRatio", "none");
                
                console.log(`[PatternManager] Transparent pattern "${patternId}" created (no white background)`);
                resolve();
            };
            
            img.src = `data:image/png;base64,${patternInfo.base64}`;
        });
    }
    // Get pattern image data URI for a given pattern ID
    getPatternImageDataURI(patternId) {
        const patternInfo = this.availablePatterns.find(p => p.id === patternId);
        return patternInfo ? `data:image/png;base64,${patternInfo.base64}` : null;
    }

    // Get pattern preview (returns data URI for use in legend)
    getPatternPreview(patternId) {
        return this.getPatternImageDataURI(patternId);
    }

    // Get color for condition
    getColorForCondition(condition) {
        // Return custom color if set, otherwise use color scale
        if (this.conditionColorMap[condition]) {
            return this.conditionColorMap[condition];
        }
        return this.colorScale ? this.colorScale(condition) : '#fff';
    }
    
    // Set custom color for a condition
    setColorForCondition(condition, color) {
        console.log(`[PatternManager] Setting color "${color}" for condition "${condition}"`);
        this.conditionColorMap[condition] = color;
        return color;
    }
    
    // Get condition currently using a specific color
    getConditionByColor(color) {
        for (const [condition, assignedColor] of Object.entries(this.conditionColorMap)) {
            if (assignedColor === color) {
                return condition;
            }
        }
        return null;
    }

    // Reset all patterns
    reset() {
        this.conditionPatternMap = {};
        this.usedPatterns.clear();
    }
}

// Create global instance immediately
window.patternManager = new window.PatternManager();

console.log('[PatternManager] Global instance created and ready');